- (BOOL)matchString:(char *)s
{
	NSInteger saved = _index;

	while (*s) {
		if (_index >= _limit) return NO;
		if (_cstring[_index] != *s)
		{
			_index = saved;
			yyprintf(@"  fail matchString '%s'", s);
			return NO;
		}
		++s;
		++_index;
	}

    yyprintf(@"  ok   matchString '%s'", s);
    return YES;
}

- (BOOL)matchClass:(unsigned char *)bits
{
